const myAudioB64 = "data:audio/mpeg;base64,";


let observer = new MutationObserver((mutations) => {
  const addedElement = mutations[0].addedNodes[0];
  if (addedElement.tagName != undefined && addedElement.tagName == "AUDIO") {
    addedElement.src = myAudioB64;
    addedElement.play();
    observer.disconnect();
  }
});

observer.observe(document.body, {
  childList: true,
  subtree: true,
  attributes: false,
  characterData: false
});